import React, { Component } from 'react';
export default class Contacts extends Component {
  render() {

    let resumeData = this.props.resumeData;

    return (
      <React.Fragment>
      <footer>
        <div className="row">

          <h2>Contact Me</h2>

          <div className="twelve columns">

          <ul className="social">
              <li><a href={resumeData.facebookLink} target="_blank"><i className="fa fa-facebook" /></a></li>
              <li><a href={resumeData.linkedinLink} target="_blank"><i className="fa fa-linkedin" /></a></li>
              <li><a href={resumeData.gmailLink} target="_blank"><i className="fa fa-envelope" /></a></li>
          </ul>


            <ul className="resources">
              <li>Addtional Resources Consulted: </li>
              <li>React tutorial from Saurabh Mhatre <a title="Styleshout" href="https://medium.com/technoetics/create-a-developer-portfolio-using-reactjs-d34ea1bfb18e">(Medium Blog)</a></li>
              <li>Original design by Ceevee <a title="Styleshout" href="https://medium.com/technoetics/create-a-developer-portfolio-using-reactjs-d34ea1bfb18e">(Styleshout)</a></li>   
            </ul>
          </div>
          <div id="go-top"><a className="smoothscroll" title="Back to Top" href="#home"><i className="icon-up-open" /></a></div>
        </div>
      </footer> 
      </React.Fragment>
    );
  }
}
